				description:
					'If you’ve been craving a restaurant-worthy three-course meal, you’re not the only one. The good news is: you can definitely make one at home — and it’s not as complicated as you might think! Start with <a href="https://tasty.co/recipe/bacon-asparagus-pastry-twists">bacon and asparagus pastry twists</a> for the appetizer. Then, move on to the main with some <a href="https://tasty.co/recipe/creamy-tuscan-chicken">creamy tuscan chicken</a>. It’ll be delicious, but make sure you save some room for dessert: a two-ingredient <a href="https://tasty.co/recipe/chocolate-chip-skillet-cookie">chocolate chip skillet cookie</a> served with ice cream.',
