					'We’ve all been there: It’s date night, and you’re already flustered. Your special someone will be here any minute, and you’re a bundle of nerves. Luckily, we’re here to make date night just a little bit easier. You’re welcome.\n\nIn fact, getting fancy for your special night doesn’t get much simpler than this. From fancy yet doable appetizers like <a href="https://tasty.co/recipe/bacon-asparagus-pastry-twists">bacon asparagus pastry twists</a> to a <a href="https://tasty.co/recipe/molten-lava-brownie">delicious molten lava brownie</a> that oozes romance, we’ve got everything you need to make your night with your loved one especially delicious.\n\nPutting together an impressive 3-course meal doesn’t have to be tough. Pretty soon, you’ll be feeding each other spoonfuls of chocolatey goodness over your latest Netflix addiction. Trust us, and let’s get cooking!   \n',
